$(document).ready(function(){
    var devMode = false;

    if(devMode){
        $("#site-css").remove();
        window.location.hash = "!watch";
    }

    // common variables
    var $window = $(window)
    var pageWidth = $window.width();
    var scrolled = $window.scrollTop();



    // base functions
    $window.scroll(function() {
        scrolled = $window.scrollTop();
        ScrollEffects();
    });

    $window.resize(function() {
        pageWidth = $window.width();
    });



    // fun variables
    var welcomeTitle = $(".welcome-title");
    var bigActions = $(".big-actions");



    // fun functions
    function ScrollEffects(){
        //console.log(scrolled);
        // home page effects
        /*if(pageWidth > 959){
            if(scrolled > 180){
                $(welcomeTitle).css({
                    marginTop : scrolled - 165
                });
            } else{
                $(welcomeTitle).css({
                    marginTop : 0
                });
            }
        }*/

        $("li.has-mega").removeClass("active");
    }



    // search show
    /*$("a.to-search").click(function(){
        $("#do-search").animate({
            marginTop: 0
        }, 300);

        return false;
    });*/


    // sliders
    $(".slide-nav li a").click(function(){
        $(".slide-nav li a").removeClass("active");
        $(this).addClass("active");

        $(".slides li").hide();
        $($(this).attr("href")).fadeIn();

        return false;
    });



    var thumbs = $(".gallery-nav ul");
    var thumbContainer = $(".gallery-nav");
    var thumbIn = $(".gallery-nav-in");
    var offsetTotal = 0;
    var moveDistance = 200;
    var diff = (thumbContainer.width() + 21) - thumbs.width();

    $("a.jump-next").click(function(){
        var currentOffset = thumbs.css('marginLeft').replace('px', '');
        console.log("current offset " +currentOffset);

        if(currentOffset-moveDistance > diff){
            offsetTotal += moveDistance;
        } else {
            offsetTotal = -diff;
        }

        console.log("offset total " + offsetTotal);

        $(thumbs).animate({
            marginLeft: -offsetTotal
        }, 300);

        return false;
    });

    $("a.jump-previous").click(function(){
        var currentOffset = thumbs.css('marginLeft').replace('px', '');

        if(currentOffset <= -moveDistance){
            offsetTotal = offsetTotal - moveDistance;
        } else {
            offsetTotal = 0;
        }

        $(thumbs).animate({
            marginLeft: -offsetTotal
        }, 300);

        return false;
    });

    $(".gallery-nav li a").click(function(){
        $(".gallery-nav li a").removeClass("active");
        $(this).addClass("active");

        $(".gallery-main li").hide();
        $($(this).attr("href")).fadeIn();

        return false;
    });

    $("li.has-mega").click(function(){
        $(this).toggleClass("active");
    });



    // post setup calls
    ScrollEffects();
});
