var app = (function() {
    'use strict';

    var s;
    return {
        settings: {
            document: $(document),
            pathname: window.location.pathname,
            html: $('html'),
            search: {
                button: '.to-search',
                input: '#keywords',
                field: '#do-search'
            }
        },

        init: function () {
            s = this.settings;

            //this.overrideBSDropdown();
            this.clickableSubmenuDropdowns();
            this.initSearch();

            $('p').each(function() {
                var p = $(this);
                if(p.text() == '\xa0') p.remove();
            });

            if ($('.ff_composer').length > 0) {
                this.styleForms();
            }

            var segments = s.pathname.slice(1, s.pathname.length).split('/');

            switch(segments[0]) {
                case "news":
                case "events":
                    this.bindCategorySelection('#department_filter');
                    var category = this.getSelectedCategory('#department_filter');
                    this.initSelectedCategories(category);
                    break;
                default:
                    break;
            }

            switch (s.pathname) {
                case "/":
                    s.html.addClass('home');
                    this.upcomingEvents.init();
                    break;
                default:
                    break;
            }
        },

        // sliders
        rotateNews: function() {
            var totalSlides = $('.slide-nav li a').length;
            var nextIndex = (parseInt($(".slide-nav li a.active").attr('href').split('-')[1]) + 1) % (totalSlides + 1);
            nextIndex = (nextIndex == 0) ? 1 : nextIndex;
            var selector = '.slide-nav li a[href="#slide-' + nextIndex + '"]';
            $(selector).trigger('click');
        },

        bindCategorySelection: function(selector) {
            $(selector).bind('change', function() {
                var url = $(this).find(':selected').data('uri');
                if(url) {
                    window.location = url;
                }
                return false;
            });
        },

        getSelectedCategory: function(selector){
            var select = $(selector);
            return (select.val() == 0) ? null : select.val();
        },

        initSelectedCategories: function(category) {
            //hide no-results
            $('.article-excerpt.no-results').css('display', 'none');

            //if we are at the home url don't select anything
            if(!category) return;

            //hide all articles
            $('.article-excerpt').css('display', 'none');

            //select the filtered entries and show them.
            var selected = $('.article-excerpt.' + category);
            if(selected.length < 1) {
                $('.article-excerpt.no-results').show('slow');
                return;
            }
            selected.fadeIn('slow');
        },

        initSearch: function() {
            var toggleSearch = function() {
                var search = $(s.search.field);
                var browserSucks = ($('html').hasClass('lt-ie7') || $('html').hasClass('lt-ie8') || $('html').hasClass('lt-ie9'));

                if(browserSucks) {
                    alert('yup!');
                    if(search.css('top') == '-100px') {
                        search.animate({top: '155px'}, 200);
                        $(s.search.input).focus();
                        return;
                    }
                    search.animate({top: '-100px'}, 100);
                    return;
                }

                if(search.hasClass('open')) {
                    search.removeClass('open');
                    return;
                }
                search.addClass('open');
                $(s.search.input).focus();
            };

            $(s.search.button).on('click', toggleSearch);
            //$(s.search.input).on('blur', toggleSearch);
        },

        /*overrideBSDropdown: function () {
            $('.dropdown-toggle').click(function (e) {
                if ($(this).attr('id') !== 'more-dropdown' && $(window).width() > 700) {
                    var location = $(this).attr('href');
                    window.location.href = location;
                    return false;
                }
            });
        },*/

        clickableSubmenuDropdowns: function() {
            $(".dropdown-menu > li > a.trigger").on("click",function(e){
                var current=$(this).next();
                var grandparent=$(this).parent().parent();
                if($(this).hasClass('left-caret')||$(this).hasClass('right-caret'))
                    $(this).toggleClass('right-caret left-caret');
                grandparent.find('.left-caret').not(this).toggleClass('right-caret left-caret');
                grandparent.find(".sub-menu:visible").not(current).hide();
                current.toggle();
                e.stopPropagation();
            });
            $(".dropdown-menu > li > a:not(.trigger)").on("click",function(){
                var root=$(this).closest('.dropdown');
                root.find('.left-caret').toggleClass('right-caret left-caret');
                root.find('.sub-menu:visible').hide();
            });
        },

        styleForms: function() {
            var composer = $('.ff_composer');
            composer.parent('form').css('float','left').after('<div class="clearfix"></div>');
            composer.removeClass('ff_composer');

            $('.line').removeClass('line').addClass('row').addClass('iwrap');
            $('.size1of1').removeClass('size1of1').addClass('col-sm-12');
            $('.size1of2').removeClass('size1of2').addClass('col-sm-6');
            $('.size1of3').removeClass('size1of3').addClass('col-sm-4');
            $('.size1of4').removeClass('size1of4').addClass('col-sm-3');
            $('.required_item').removeClass('required_item').css('color', 'red').css('padding', '0 5px');

            //$('[type="text"], select, textarea').addClass('form-control');
            //$('[type="submit"]').addClass('btn btn-jclinic');

            //$('input:not([type="hidden"])').unwrap().unwrap();
            //$('.line').removeClass('line').addClass('iwrap').unwrap();

            $('.row.iwrap .unit dd').each(function() {
                var element = $(this);
                element.replaceWith('<label>' + element.text() + '</label');
            });

            $('input[type="submit"]').addClass('button');
        },

        responsiveCarousel: function() {
            var client_width = $(document).width();
            //
            console.log('doing stuff %o', client_width);
        },

        upcomingEvents:  {
            init: function() {
                var self = this;
                $('#week, #month, #week_preview, #month_preview').css('display', 'none');
                $('#today_toggle, #week_toggle, #month_toggle').on('click', function(e) {
                    e.preventDefault();
                    self.toggleFilter($(this).attr('id').split('_')[0]);
                });

                $('.event_filter').on('click', function(e) {
                    e.preventDefault();
                    self.toggleEvent($(this).attr('id'));
                });

                $('#month_toggle').trigger('click');
            },

            toggleFilter: function(filter) {
                $('#today_toggle, #week_toggle, #month_toggle').removeClass('active');
                $('#today, #week, #month').css('display', 'none');
                $('#today_preview, #week_preview, #month_preview').css('display', 'none');

                $('#' + filter + '_toggle').addClass('active');
                $('#' + filter).css('display', 'block');
                $('#' + filter + '_preview').css('display', 'block');
                $('#' + filter + '_preview > article').css('display', 'none');
                $('.event_filter').removeClass('active');

                var first_event = $('#' + filter + '_preview > article:first-of-type');
                console.log(first_event.length);
                var first_event_info = first_event.attr('id').split('_');
                $('#' + first_event_info[0] + '_' + first_event_info[1]).addClass('active');
                first_event.css('display', 'block');
            },

            toggleEvent: function(event_summary_id) {
                var filter = event_summary_id.split('_')[0];
                $('.event_filter').removeClass('active');
                $('#' + filter + '_preview > article').css('display', 'none');

                $('#' + event_summary_id).addClass('active');
                $('#' + event_summary_id + '_preview').fadeIn(750);
            }
        }
    };
})();

$(document).ready(function() {
    app.init();
    var tables = $('table');
    if(tables.length > 0) {
        tables.removeAttr('border')
            .removeAttr('cellpadding')
            .removeAttr('cellspacing')
            .removeAttr('style')
            .addClass('table table-condensed table-striped');
    }

    //slider rotation
    if($('html').hasClass('home')) {
        setInterval(function () {
            app.rotateNews();
        }, 5000);
    }

    if($('html').hasClass('home')) {
        $(window).bind('resize', app.responsiveCarousel);
    }
});

